interface IconProps {
    width: number
    height: number
    viewBox: string
    name: string
}

const icons = [
    {
        name: 'arrow',
        path: 'asdf',
    },
]

export type IconName = typeof icons[]

export const Icon = ({name, width, height, viewBox}: IconProps) => {
    const path = icons.find(item => item.name === name && item.path);
    return (
        <svg width={width} height={height} viewBox={viewBox} xmlns="http://www.w3.org/2000/svg">
            <path d={path}/>
        </svg>
    )
}
